    public static class BlocksExtensions
    {
        private static readonly Dictionary<short, Blocks> lookup = new Dictionary<short, Blocks>();
        private static readonly Dictionary<Blocks, ElementInformation> blockInfoCache = new Dictionary<Blocks, ElementInformation>();

        static BlocksExtensions()
        {
            foreach (Blocks b in Enum.GetValues(typeof(Blocks)))
            {
                lookup[(short)b] = b;
            }
        }

        public static Blocks FromId(short id)
        {
            return lookup.TryGetValue(id, out Blocks blocks) ? blocks : Blocks.EmptySpace;
        }

        public static ElementInformation GetInfo(this Blocks b)
        {
            if (!blockInfoCache.ContainsKey(b))
            {
                blockInfoCache[b] = ElementKeyMap.GetInfoFast((short)b);
            }
            return blockInfoCache[b];
        }

        public static short GetId(this Blocks b)
        {
            return (short)b;
        }

        public static long GetPlayerUsableId(this Blocks b)
        {
            return PlayerUsableHelper.GetPlayerUsableId((short)b);
        }
    }
